/// <summary>
/// BitSet implementation lifted from MicroWorks lol.
/// </summary>
internal class BitSet
{
    public int Count { get; private set; }

    private readonly byte[] _backing;

    public BitSet(int count)
    {
        _backing = new byte[(count / 8) + 1];
        Count = count;
    }

    public BitSet(byte[] backing)
    {
        _backing = backing;
        Count = backing.Length * 64;
    }

    public void SetBit(int position, bool state)
    {
        var bytePos = position / 8;
        var bitPos = position % 8;

        if (state)
        {
            _backing[bytePos] |= (byte)(1 << bitPos);
        }
        else
        {
            _backing[bytePos] &= (byte)(~(1 << bitPos));
        }
    }

    public bool GetBit(int position)
    {
        var bytePos = position / 8;
        var bitPos = position % 8;

        return (_backing[bytePos] & (1 << 7 - bitPos)) != 0;
    }

    public byte[] GetBacking() => _backing;

    public void Clear()
    {
        for (var i = 0; i < _backing.Length; i++)
            _backing[i] = 0;
    }

    public bool this[int i]
    {
        get => GetBit(i);
        set => SetBit(i, value);
    }
}

