    /// <inheritdoc/>
    public override string Name => "BadApple";

    /// <summary>
    /// The bad apple realm.
    /// </summary>
    private readonly IRealm _badAppleRealm;

    /// <summary>
    /// Is it playing yet.
    /// </summary>
    private volatile bool _playing = false;

    /// <summary>
    /// The last frame time.
    /// </summary>
    private Stopwatch _sw = new();

    /// <summary>
    /// The last frame.
    /// </summary>
    private int _lastFrame = 0;

    /// <summary>
    /// The framerate.
    /// </summary>
    private readonly double _frameRate;

    /// <summary>
    /// Creates a new bad apple plugin.
    /// </summary>
    /// <param name="server"></param>
    public BadApplePlugin(IServer server)
        : base(server)
    {
        // Garbage estimate, had to speed up by 108% in Kdenlive to sorta match Bad Apple.
        // Probably because Tako ticks are constant-time.
        _frameRate = 220d / _frames.Count;

        _badAppleRealm = server.RealmManager
            .GetOrCreateRealm("badapple", RealmCreationOptions.None);

        _badAppleRealm.GetWorldGenerator()
            .WithDimensions(new Vector3Int(26, 45, 26))
            .WithType(Definitions.Game.World.WorldType.Flat)
            .Build();

        server.OnServerTick.Subscribe(TickBadApple);

        server.Chat.RegisterChatCommand("badapple", (_, _) =>
        {
            if (!_playing)
                PlayBadApple();
        });
    }

    private EventHandlingResult TickBadApple(float _)
    {
        if (_playing)
        {
            if (_sw.ElapsedMilliseconds / 1000d < _frameRate)
                return EventHandlingResult.Continue;

            var set = new BitSet(_frames[_lastFrame]);

            var y = 43;
            var x = 0;
            for (var i = 0; i < 26 * 20; i++)
            {
                var bit = set.GetBit(i);
                if (bit)
                    _badAppleRealm.World!.SetBlock(new Vector3Int(x, y, 0), (byte)ClassicBlockType.White);
                else
                    _badAppleRealm.World!.SetBlock(new Vector3Int(x, y, 0), (byte)ClassicBlockType.DarkGrey);

                x++;
                if (x >= 26)
                {
                    x = 0;
                    y -= 1;
                }
            }

            _sw.Restart();

            _lastFrame++;
            if (_lastFrame >= _frames.Count)
                _playing = false;
        }
        return EventHandlingResult.Continue;
    }

    /// <summary>
    /// Plays bad apple.
    /// </summary>
    private void PlayBadApple()
    {
        _playing = true;
        _sw.Start();

        Server.Chat.SendServerMessageTo(_badAppleRealm, "Playing bad apple...");
    }
